import React from "react";

function Deals() {
    return (
        <div class = "grid-container">
            <div class = "wheelitem">

            </div>
            <div class = "dailydeals">
                <div class = "dealcard rounded">
                <img class = "ddealimgfirst" src="./images/hamburger-beside-fries-2271107.png" alt="food-deal"/>
                   
                    <button class=" ddealbtn button-error pure-button">Daily Deal</button>
                </div>

            </div>
            <div class = "weeklydeals">
            <div class = "dealcard rounded">
                    <img class = "wdealimgfirst" src="./images/hamburger-beside-fries-2271107.png" alt="food-deal"/>
                    
                    <img class = "wdealimgsecond" src="./images/club-sandwich-served-on-chopping-board-1600711.png" alt="food-deal"/>
                    <button class=" wdealbtn button-error pure-button">Weekly Deal</button>
                </div>
            </div>
        </div>
    );
}

export default Deals;
